'''Gabooty's Tai Bwo Wannai Cooperative''' is a store located in [[Tai Bwo Wannai]], owned by [[Gabooty]]. It sells [[machete]]s and [[villager clothing]], and will buy semi-precious gems and [[gout tuber]]s. Gabooty also runs [[Gabooty's Tai Bwo Wannai Drinky Store]].

